import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <div class="ui three item menu">
      <a class="item">Recent Search</a>
      <a class="item">Filtered Stream</a>
      <a class="item">Filtered Stream + Annotations</a>
    </div>
  );
};

export default Navbar;
